import React from 'react';
import './App.css';
import { connect } from 'react-redux';
import {nameData} from './actions/formActions'
import { Container } from '@material-ui/core';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';
import Box from '@material-ui/core/Box';
import Button from '@material-ui/core/Button';

import Grid from '@material-ui/core/Grid';

class App extends React.Component{


  classes = {
    container: { 
      backgroundColor: '#ccf0e1', 
      height: '80vh', 
      marginTop:'10vh' 
    },
    root: {
      width: '100%'
    },
    heading:{
      color: '#084177'
    },
  };


  doThing = () => {
    this.props.dispatch(nameData({firstName:'Max', middleName: 'tonk', lastName:'Payne'}))
  }

  render(){
    console.log(this.classes);
    return (
      <Container maxWidth="md">
            <Typography component="div" style={this.classes.container} border={1}>
              <form noValidate autoComplete="off" style={{height: "100%"}}>
                <Grid container justify="center" direction="column" alignItems="center" spacing={5}>
                  <Grid item xs={12}>
                    <h2 style={this.classes.heading}>Let's get your Name</h2>
                  </Grid>
                  <Grid item xs={4} style={this.classes.root}>
                     <TextField style={this.classes.root} label="First Name" variant="outlined" />
                  </Grid>
                  <Grid item xs={4} style={this.classes.root}>
                     <TextField style={this.classes.root}  label="Middle Name" variant="outlined" />
                  </Grid>
                  <Grid item xs={4} style={this.classes.root}>
                     <TextField style={this.classes.root}  label="Last Name" variant="outlined" />
                  </Grid>
                  <Grid item xs={4}>
                 </Grid>
                 <Grid item xs={4}>
                 </Grid>
                 <Grid item xs={4}>
                 </Grid>
                 <Grid item xs={4}>
                 <Button variant="outlined" color="primary" >
                            Primary
                    </Button>
                 </Grid>
                </Grid>
              </form>
            </Typography>
      </Container>
    );
  }
}

function mapStateToProps(state){
  return state;
}

export default connect(mapStateToProps)(App);
